package sample_0324;

public class apartment {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int j=9;j>0;j--){
				for(int i=1;i<9;i++){
					if((j>=6)&&(i==6)){	
						break;
				}
					System.out.print(j*100+i);
					System.out.print("  ");
					}
					System.out.println("  ");
			}
		}

	}


